import { ADD_DIARY } from '../actions/types';

const diaryReducer = (diaries = [], action) => {
    switch (action.type) {
        case ADD_DIARY:
            console.log(action);
            return [...diaries, action.payload]
        default:
            return diaries;
    }
}


export default diaryReducer;
